import React, { useState } from 'react';

const Event=()=>{
    const bgChange=()=>{
        const purple="#8e44ad";
        const [bg,setBg]=useState(purple);
    };
    return(
        <>
            <div style={{backgroundColor:bg}}>
                <button onClick={bgChange}>Click Me</button>
            </div>
        </>
    );
};

export default Event;
